import ProductCard from "../ProductCard";

function ProductList({ list, isCart }) {
  return (
    <section>
      <h2>{isCart ? "Carrinho" : "Produtos"}</h2>
      <ul>
        {list.map((product, index) => (
          <li key={index}>
            <ProductCard product={product} isCart={isCart} />
          </li>
        ))}
      </ul>
    </section>
  );
}

export default ProductList;
